import React from 'react';
import FooterList from './footerlist.js';

function Footer() {
  const linkDataA = [
    { text: "Home" },
    { text: "About" },
    { text: "Menu" },
    { text: "Reservations" },
    { text: "Order Online" },
    { text: "Login" }
  ];

  const linkDataB = [
    { text: "Address" },
    { text: "Phone Number" },
    { text: "Email" }
  ];

  const linkDataC = [
    { text: "Address" },
    { text: "Phone Number" },
    { text: "Email" }
  ];
  return (
    <footer>
      {/* TODO: Footer should have 3 FooterList components. Each of those should dynamically create lists. */}
    <nav className={"footer-container"}>
        <FooterList title={"Navigation"} linkData={linkDataA}/>
        <FooterList title={"Contact"} linkData={linkDataB}/>
        <FooterList title={"Social Media"} linkData={linkDataC}/>
    </nav>
</footer>
)};

export default Footer;
